import React from 'react';
import { Modal, ModalHeader, ModalBody } from 'reactstrap';

const ModalWrapper = ({ isOpenModal, toggle, children, style, backdrop }) => (
    <Modal autoFocus isOpen={isOpenModal} toggle={toggle} 
    className="sign-up-modal cancellation-modal" style={style} backdrop={backdrop}>
		<ModalHeader style={{ paddingBottom: '0' }} toggle={toggle} />
		<ModalBody style={{ paddingTop: '0', paddingBottom: '0' }}>
			{children}
		</ModalBody>
	</Modal>

);

export default ModalWrapper;
